import React, { Component } from "react";
import { BrowserRouter as Router, Route } from "react-router-dom";
import { Container } from "semantic-ui-react";

import "../css/App.css";

import Sidebar from "./Sidebar";
import Content from "./Content";

function App() {
  return (
    <Router>
      <Container>
        <Sidebar />
        <Header />
      </Container>
    </Router>
  );
}

export default App;
